import Paper from "@mui/material/Paper";
import { Typography } from "@mui/material";

function LoginingReq({data,running,numberShow, Services, width}) {
    return (
        <Paper sx={{width:{width}, height:"150px"}}>
              <Typography variant ="h6" align ="left" padding={2}>Logging Comments</Typography>
              <Typography variant ="subtitle2" align ="left" padding={2}>{numberShow}</Typography>
             <Typography variant ="subtitle2" align ="left" padding={2}>{running} <br/> Services</Typography>

             <p>as</p>
             <p>as</p>
          </Paper>
    );
}
export default LoginingReq;
